    public static String getExchange(String key, String currencyType){
        CurrencyRates currencyRates = CURRENCY_RATES_MAP.get(key);
        if (currencyType.contains(CurrencyType.USD.name())){
            return currencyRates.getUsd();
        } else if (currencyType.contains(CurrencyType.EUR.name())) {
            return currencyRates.getEur();
        } else if (currencyType.contains(CurrencyType.RUR.name()) || currencyType.contains(CurrencyType.RUB.name())) {
            return currencyRates.getRur();
        } else if (currencyType.contains(CurrencyType.PLN.name())) {
            return currencyRates.getRur();
        } else {
            return "x";
        }
    }


